// src/components/TreatmentPlan.js
import React from 'react';
import { Link } from 'react-router-dom';

function TreatmentPlan() {
  return (
    <div className="treatment-plan">
      <h2>Treatment Plan</h2>
      <nav>
        <button><Link to="/treatment-plan/food">Food</Link></button>
        <button><Link to="/treatment-plan/herbs">Herbs</Link></button>
        <button><Link to="/treatment-plan/lifestyle">Lifestyle</Link></button>
      </nav>
    </div>
  );
}

export default TreatmentPlan;
